import NavBar from "../components/navbar/Nav";

export default function HeaderComponent() {
    return (
        <header className="">
            <section className="flex flex-row">
                <div className="pl-[80px] basis"><h2 className="text-[20px]">Vpay</h2></div>
                <div className="flex flex-row">
                    <NavBar />
                    <div className=""><button className="px-[25px] py-[10px] m-0 bg-[#0D1D32] text-white rounded-[30px]">Sign Up</button></div>
                </div>
            </section>
        </header>
    );
}
